import React from 'react';
import './index.css';
import ProfileImage from './profile.jpg'; // Adjust the path based on your folder structure

const About = () => {
    return (
        <section id="about" className="about">
            <h2>About Me</h2>
            <div className="about-content">
                <img src="./Assets/image.png" alt="Lalitha Vislavath" className="profile-image" />
                <div className="about-text">
                    <p>Hello! I'm Lalitha Vislavath, a developer specializing in building modern and responsive web applications. I love solving problems and delivering user-friendly designs.</p>
                    <h3>Skills:</h3>
                    <ul>
                        <li>HTML</li>
                        <li>CSS</li>
                        <li>JavaScript</li>
                        <li>React JS</li>
                        <li>Node.js</li>
                    </ul>
                </div>
            </div>
        </section>
    );
};

export default About;
